import React from "react";

export default function About() {
  return (
    <div className="About">
      <div className="About__img">
        <img src="../assets/my_image.jpg" alt="This is me" />
      </div>
      <div className="About__des">
        <p>
          I have 3 years in Front-end Web Developer position.
          <br />
          I'm looking for a professional and international environment to apply
          my skills and my ablities.
          <br />
        </p>
      </div>
    </div>
  );
}
